import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'
import styled from 'styled-components'

const NavBar = styled.nav`
    display: flex;
    justify-content: space-around;
    align-items: center;
    height: 12vh;
    width: 100vw;
    margin: 0;
    padding: 0;
    background-color:gray;
    a{
        text-decoration: none;
        color:black;
        font-size: 1.3rem;
    }
    a:hover{
        text-decoration: none;
        color:white;

    }
`

class NavbarUser extends Component {
    render() {
        return (

            <NavBar>
                <div>Logo</div>
                <NavLink to={"/sistema/vendas"}>vendas</NavLink>
                <NavLink to={"/sistema/orçamento"}>orçamento</NavLink>
                <NavLink to={"/sistema/estoque"}>estoque</NavLink>
                <NavLink to={"/sistema/faturamento"}>faturamento</NavLink>
                <NavLink to={"/sistema/novo-funcionario"}>Novo Funcionário</NavLink>
            </NavBar>
        )
    }
}

export default NavbarUser
